import React from "react";
import "./stamp.css";

const StampPads = () => {
  const printers = [
    {
      printer: "Printer C 10",
      size: "10 x 27 mm",
      packaging: "Packaging",
      handle: "E/10",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
      imgSrc: "/images/products/b2.png", // Replace with actual image path
    },
    {
      printer: "Printer C 20",
      size: "14 x 38 mm",
      packaging: "Packaging",
      handle: "E/20",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
      imgSrc: "/printer_c20.png", // Replace with actual image path
    },
    {
      printer: "Printer C 30",
      size: "18 x 47 mm",
      packaging: "Packaging",
      handle: "E/30",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
      imgSrc: "/printer_c30.png", // Replace with actual image path
    },
  ];

  return (
    <>
      <div className="container pt-5">
        <div className="row">
          <div className="col-md-2">\
            <img src="/images/products/n1.jpg" height={270} width={210} alt="" />
          </div>
          <div className="col-md-6">
            <div>
              <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Ipsam optio illum temporibus! Rem modi ex assumenda corporis itaque sit, nam fugit qui facere quos ad harum neque exercitationem soluta eum sapiente obcaecati. Totam libero eveniet voluptatem harum quas dolorem id ducimus omnis repellendus perferendis nam magni eum quam, earum ab atque ipsam ut asperiores quod expedita. Reprehenderit dolorum eveniet porro vitae molestiae officia quia velit magnam exercitationem in sint impedit, iure dolore possimus ipsum et sequi atque consequuntur placeat optio. Alias, excepturi perferendis impedit asperiores adipisci harum quasi debitis assumenda soluta laboriosam exercitationem facere nisi tenetur minima quas, rerum dignissimos.</p>
            </div>
          </div>
          <div className="col-md-4">
            <div className="d-flex">
              <h3>Printer C 10 </h3>
              <div  >
                <div>
                  <div className="d-flex">
                    <img src="" alt="" />
                    <p>size of imprint</p>
                  </div>
                  <div className="d-flex">
                    <img src="" alt="" />
                    <p>size of imprint</p>
                  </div>
                  <div className="d-flex" >
                    <img src="" alt="" />
                    <p>size of imprint</p>
                  </div>
                </div>

                <div>
                  <div>
                    <div className="d-flex">
                      <img src="" alt="" />
                      <p>size of imprint</p>
                    </div>
                    <div className="d-flex">
                      <img src="" alt="" />
                      <p>size of imprint</p>
                    </div>
                    <div className="d-flex" >
                      <img src="" alt="" />
                      <p>size of imprint</p>
                    </div>
                  </div>
                </div>
              </div>
            </div>

          </div>
        </div>
      </div>


    </>



    // <div className="app">
    //   {printers.map((printer, index) => (
    //     <div className="card" key={index}>
    //       {/* First Column: Image */}
    //       <div className="card-column image-column">
    //         <img src={printer.imgSrc} alt={printer.printer} />
    //       </div>
    //       {/* Second Column: Brand Name */}
    //       <div className="card-column brand-column">
    //         <h3>{printer.printer}</h3>
    //       </div>
    //       {/* Third Column: Product Details */}
    //       <div className="card-column details-column">
    //         <p>
    //           <strong>Size of Imprint:</strong> {printer.size}
    //         </p>
    //         <p>
    //           <strong>Packaging:</strong> {printer.packaging}
    //         </p>
    //         <p>
    //           <strong>Colour of Handle:</strong> {printer.handle}
    //         </p>
    //         <p>
    //           <strong>Spare Pad:</strong> {printer.sparePad}
    //         </p>
    //         <p>
    //           <strong>Optional Cover:</strong> {printer.optionalCover}
    //         </p>
    //       </div>
    //     </div>
    //   ))}
    // </div>
  );
};

export default StampPads;
